  }


  return (
    <ul className={classes['movies-list']}>
      {props.movies.map((movie) => {

        // console.log(movie);

        return (<Movie onDeleteUser={onDeleteUserClicked} 
          key={movie.id}
          title={movie.title}
          releaseDate={movie.releaseDate}
          openingText={movie.openingText}
          image={movie.image}
        />)

        })}
    </ul>
  );
};

export default MovieList;
